import React, { useState, useEffect } from "react";
import axios from "axios";
import { log } from "async";

function App() {
  let fetchData = async () => {
    try {
      let res = await axios.get(
        "https://api.nasa.gov/EPIC/api/natural?api_key=0VQHai1DdOa13R31A5H4kdGZbiVnfRrA8bIVvi3l"
      );
      console.log(res);
    } catch (err) {
      console.log(err);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);
  const [getData, setgetData] = useState([]);

  return (
    <div>
      <button>Trial</button>
    </div>
  );
}

export default App;
